        <nav  className="collectieNavigation">
            <ul className="collectieNavigation__">
                <li className="collectieNavigation__listItem"></li>
                <li className="collectieNavigation__listItem"></li>
                <li className="collectieNavigation__listItem"></li>
                <li className="collectieNavigation__listItem"></li>
                <li className="collectieNavigation__listItem"></li>
            </ul>
        </nav>
    )
}

export default CollectieNav;
